import React, {useContext, useEffect, useState} from "react";
import {
	Row,
	Col,
	Card,
	CardBody,
	Container,
	Modal,
	ModalHeader,
	FormGroup,
	Label,
	Input,
	ModalBody,
	ModalFooter,
	Button,
} from "reactstrap";
//Import Breadcrumb
import Breadcrumbs from "../../components/Common/Breadcrumb";
import AddUser from "./AddUser";
import GetUsers from "./GetUsers";
import {AvForm, AvField, AvInput} from "availity-reactstrap-validation";
import faceContext from "../../context/face/faceContext";
import Nivel from "./Nivel";

const ConfidenceLevels = (props) => {
	const {className} = props;
	const [modal, setModal] = useState(false);

	const facesContext = useContext(faceContext);
	const {obtenerFaces, faces} = facesContext;

	const toggle = () => setModal(!modal);

	useEffect(() => {
		obtenerFaces();
	}, []);

	const niveles = [
		{
			_id: "603da0a6eb8f05781004234e",
			name: "Maurizo",
			surname: "Volpe",
			age: 26,
			gender: "Masculino",
			image: null,
			confidenceLevels: "60316459aea69a7200c32a64",
			__v: 0,
		},
		{
			_id: "603da0b4eb8f05781004234f",
			name: "Valentina",
			surname: "Volpe",
			age: 22,
			gender: "Femenino",
			image: null,
			confidenceLevels: "60316459aea69a7200c32a64",
			__v: 0,
		},
		{
			_id: "603be68bc1515782703242c3",
			name: "add",
			surname: "dds",
			age: 24,
			gender: "Masculino",
			image: null,
			confidenceLevels: "60316459aea69a7200c32a64",
			__v: 0,
		},
	];

	return (
		<React.Fragment>
			<div className="page-content">
				<Container fluid>
					{/*Header*/}
					<Row>
						<Col md="6">
							<Breadcrumbs title="Niveles de confianza" />
						</Col>
						<Col md="6">
							<Button
								color="dark"
								outline
								className=" waves-effect waves-light float-right mb-3"
								onClick={toggle}>
								Añadir usuario
							</Button>
						</Col>
					</Row>

					<Row>
						{faces.map((face) => (
							<Nivel key={face._id} id={face.confidenceLevels}></Nivel>
						))}
						<Col xl="6">
							<Card>
								<CardBody>
									<Row>
										<Col md="9">
											<h4 className="card-title">Nivel 1</h4>
											<p>
												Personas totalmente desconocidas pero no son
												consideradas como una amenaza.
											</p>
										</Col>
									</Row>
									<div className="table-responsive mt-2 overflow-scroll height-confidencelevels">
										getuser
									</div>
								</CardBody>
							</Card>
						</Col>
					</Row>
				</Container>
			</div>
			<Modal
				isOpen={modal}
				centered={true}
				toggle={toggle}
				className={className}>
				<AddUser toggle={toggle}></AddUser>
			</Modal>
		</React.Fragment>
	);
};

export default ConfidenceLevels;
